@Override
protected Object clone() {
  TermBuffer clone = null;
  try {
    clone = (TermBuffer)super.clone();
  } catch (CloneNotSupportedException e) {}

  clone.dirty = true;
  clone.bytes = new BytesRef(10);
  clone.text = new UnicodeUtil.UTF16Result();
  clone.text.copyText(text);
  return clone;
}

@Override
protected Object clone() {
